INSERT INTO `content` (`id`, `title`, `desc`, `youtube`, `metakey`, `lang`, `state`, `hits`, `img`, `gallery`, `img_titles`, `gen_slider`, `ticker`, `editor`, `show_hits`, `created`, `published`, `user_id`) VALUES
(1, 'Սաուդյան Արաբիան վռնդում է Եթովպիայից ապօրինի ներգաղթյալներին', 'Ինչպես հաղորդում է BBC News-ը, Եթովպիայից 23 հազար ապօրինի ներգաղթյալներ հանձնվել են Սաուդյան Արաբիայի իշխանություններին՝ անօրինական միգրացիայի դեմ տարվող մոտ մեկ շաբաթյան օպերացիայի արդյունքում: Ձերբակալվածների մի մասն արդեն արտահանձնվել է հայրենիք: Նրանց առաջին մասը Ադիս-Աբեբա է հասել նոյեմբերի 12-ին:\r\n\r\nԱնօրինական միգրանտների դեմ ճնշումները հանգեցրել են մայրաքաղաք Էռ-Ռիադում փողոցային անկարգությունների, բախումների ընթացքում առնվազն հինգ մարդ է զոհվել, որոնց մեջ՝ ինչպես ներգաղթածներ, այնպես էլ՝ Սաուդյան Արաբիայի քաղաքացիներ են:\r\n\r\nՆերգաղթայլներին երկրից դուրս մղելով, Սաուդյան Արաբիայի իշխանությունները փորձում են նվազեցնել բնիկ ազգաբնակչության շրջանում գործազրկության մակարդակը, որը 2013-ին աճել է մինչև  12 տոկոս:', '', '', 'am', 1, 0, 'http://nyut.am/disk/15-11-13/dc635251c59be3ad0c4f4cfb4f0d2ab9.jpg', '', '', 0, 0, 0, 0, '2013-11-15 11:17:22', '2013-11-15 11:17:22', 7),
(2, 'Երկրաշարժ Հարավային Օսիայում', 'Ինչպես տեղեկացնում է «Новости Грузии»-ն, նոյեմբերի 14-ին Թբիլիսիի ժամանակով ժամը 12։58-ին, Հարավային Օսիայի Ցխինվալի շրջանի Ջավա գյուղի մոտակայքում 3.2 մագնիտուդ ուժգնությամբ երկրաշարժ է գրանցվել:\r\n\r\nՎրաստանի սեյսմոլոգիական հետազոտությունների կենտրոնից տեղեկացրել են, որ երկրաշարժի էպիկենտրոնը գտնվել է Ջավայից 5 կմ հեռավորության վրա գտնվող բնակավայրերից մեկում։ Այն սահմանակից է վրացական Ռաչա շրջանին, որը համարվում է երկրի ամենասեյսմավտանգ շրջանը։', '', '', 'am', 1, 0, 'http://nyut.am/disk/15-11-13/f7d7d99012d3ae1ab02870c2f292ea59.jpg', '', '', 0, 0, 0, 0, '2013-11-15 10:59:46', '2013-11-15 10:59:46', 7),
(3, 'Դատավարություն՝ Skype-ով', 'Ինչպես հայտնում է «Euromag»-ը, Ժամանակակից համացանցային տեխնոլոգիաները բրիտանացիներին հնարավորություն կտան մասնակցել դատական նիստերին Skype տեսաձայնային ծառայության միջոցով:\r\n\r\nՆման որոշում է կայացրել թագավորության նորանշանակ գլխավոր դատավոր լորդ Թոմասը, ով մանրամասնել է, որ Skype-ով դատական նիստին մասնակցելն առավել պակաս ծախսատար է, քան այլ հեռահաղորդակցային համակարգերի օգտագործումը։\r\n\r\nՍակայն ոմանց կարծիքով՝ Skype-ով դատական նիստեր անցկացնելու դեպքում դրանք կկորցնեն իրենց լրջությունը։', '', '', 'am', 1, 0, 'http://nyut.am/disk/15-11-13/3ecc8f7e8e0fb96359c4532b717302aa.jpg', '', '', 0, 0, 0, 0, '2013-11-15 22:24:17', '2013-11-15 22:24:17', 7),
(4, 'Թուրքիայի խորհրդարանում կանայք այսուհետ կարող են տաբատ կրել', 'Ինչպես հայտնում է «Reuters»-ը, նոյեմբերի 14-ին Թուրքիայի խորհրդարանը հանել է կին պատգամավորների՝ տաբատ կրելու արգելքը:\r\n\r\nԱրգելքի կասեցման նախաձեռնողն է դարձել ընդդիմադիր պատգամավոր Սաֆակ Պավեյը, ով բազմիցս փորձել է հասնել տաբատ կրելու թույլտվության, քանի որ նրա ոտքերից մեկը փոխարինվել է պրոթեզով: Գործընկերներն ամեն անգամ մերժել են նրան՝ վկայակոչելով վաղուց սահմանված կանոնները, որոնք թույլ են տալիս կանանց միայն կիսաշրջազգեստ կրել:\r\nԱրգելքի չեղյալ հայտարարումը հնարավոր է դարձել վերջերս խորհրդարանում կանացի գլխաշորերի կրման թույլտվությունից հետո:', '', '', 'am', 1, 0, 'http://nyut.am/disk/16-11-13/4093dab9cc211bdefcafffb3f3ea2d67.jpg', '', '', 0, 0, 0, 0, '2013-11-16 08:52:09', '2013-11-16 08:52:09', 7),
(5, 'Ֆրանսիայում փակվում է դաշնամուր պատրաստող աշխարհի ամենահին գործարանը', 'Ինչպես հայտնում է բրիտանական «The Telegraph»-ը, աշխարհի ամենահին և դեռևս գործող դաշնամուր պատրաստող «Pleyel» ընկերությունը մտադիր է փակել իր վերջին արտադրամասը Սեյնթ Դեվիսում: Լեհ կոմպոզիտոր Ֆրեդերիկ Շոպենի սիրած ֆրանսիական ընկերությունը ավարտում է իր գործունեությունը՝ որպես այդ ոլորտում ամենահայտնին և ամենահմուտը:\r\n\r\nԱյս ֆրանսիական գործարանը, որը 1807-ին հիմնադրել է ավստրիական ծագումով ֆրանսիացի երգահան, երաժիշտ Իգնազ Փլեյելը, ավելի քան 250 000 դաշնամուրներ է պատրաստել այս 200-ից ավելի տարիների ընթացքում:\r\n\r\nՓլեյելն առաջինն էր, ով Ֆրանսիա ներմուծեց ուղղաձիգ դաշնամուրը, դաշնամուրներ պատրաստելիս կիրառեց մետաղական շրջանակ և հնարեց «երկարատև» կոչվող հնչյունը:', '', '', 'am', 1, 0, 'http://nyut.am/disk/16-11-13/1ef081d55adc1492dd859e8df09b0f3b.jpg', '', '', 0, 0, 0, 0, '2013-11-16 09:08:21', '2013-11-16 09:08:21', 7),
(6, 'Օլանդի վարկանիշը հասել է ռեկորդային ցածր ցուցանիշի', 'Ինչպես տեղեկացնում է ITAR-TASS-ը, համաձայն նոյեմբերի 14-ին հրապարակված՝ «YouGov» հետազոտական կենտրոնի կողմից իրականացված սոցհարցման արդյունքների, Ֆրանսիայի նախագահ Ֆրանսուա Օլանդի և նրա կառավարության հեղինակային վարկանիշը շարունակում է անկում ապրել և այս շաբաթ գրանցել է ռեկորդային ցածր ցուցանիշ: Հանրապետության ղեկավարի հանդեպ վստահության մակարդակը հասել է 15 տոկոսի նշակետին՝ աննախադեպ ցածր ցուցանիշ հինգերորդ հանրապետության ողջ պատմության ընթացքում: Հարցվածների շրջանում միայն 30 տոկոսն է հայտնել, որ «շատ գոհ է» գործող նախագահի գործունեությունից: Նման մարդկանց չափամասը անփոփոխ է մնում հոկտեմբերի ամսից: Մինչդեռ ազգային առաջնորդի քաղաքականությունից ուղղակի «գոհ» են 12 տոկոս հարցվածները, ինչը վեց տոկոսով քիչ է հոկտեմբերի համեմատ:', '', '', 'am', 1, 0, 'http://nyut.am/disk/16-11-13/031248c78db3803adc33860e637cb2bc.jpg', '', '', 0, 0, 0, 0, '2013-11-16 01:39:57', '2013-11-16 01:39:57', 7),
(7, '«Մուսուլման եղբայրները» իրենց մասին հիշեցրել են անգամ Լոնդոնում', 'Ինչպես հաղորդում է «lenta.ru»-ն՝ հղում անելով «London Evening Standart»-ին, նոյեմբերի 14-ին «Մուսուլման եղբայրներ» շարժման կողմնակիցները խափանել են եգիպտացի գիտնական Մուհամմադ Ալ-Նաբավիի Եգիպտոսի մասին դասախոսությունը Լոնդոնի համալսարանում:\r\n\r\nՇուրջ 30 իսլամիստներ ներխուժել են դասախոսության սրահ, որտեղ սկսել են կարգախոսներ վանկարկել և փորձել են հարձակվել գիտնականի վրա, ով դեռևս չէր սկսել ելույթը: Ալ-Նաբավին արագորեն հեռացել է անվտանգության աշխատակիցների ուղեկցությամբ: Նրա օրինակին են հետևել նաև դասախոսությունը լսելու եկածները:\r\n\r\nՊաղեստինյան համայնքի ղեկավարությունը, որը կազմակերպել էր հանդիպումը, ներողություն է խնդրել այս միջադեպի համար: Չի հաղորդվում՝ արդյոք նրանք պատրաստվո՞ւմ են դասախոսություն կազմակերպել ավելի ուշ, թե ոչ:', '', '', 'am', 1, 0, 'http://nyut.am/disk/15-11-13/cbe080b2bd99aa7ea045eafe9768467b.jpg', '', '', 0, 0, 0, 0, '2013-11-15 14:46:09', '2013-11-15 14:46:09', 7),
(8, 'Typhoon Haiyan: Plight of survivors ''bleak'' despite aid effort', 'Aid workers struggling to help survivors of Typhoon Haiyan in the Philippines have described the situation as bleak, one week after the storm tore into the country.\r\nA spokesman for Medecins Sans Frontieres said the logistical issues of distributing aid were enormous, BBC reports.\r\n\r\nHowever, correspondents in the ruined city of Tacloban say US military aircraft are beginning to bring in aid.\r\n\r\nA Philippine minister told the BBC the official death toll had reached 3,422.\r\n\r\nHenry Gray, of Medecins Sans Frontieres, said workers who had visited Guiuan, in eastern Samar, described the situation faced by the 45,000 people there as "bleak".\r\n\r\n"What we saw there was that a public hospital had been, basically, destroyed," he said.\r\n\r\nMr Gray added that local officials had asked the charity to support a local private clinic.\r\n\r\n"We are moving this as quickly as we possibly can, but the logistical issues are enormous and they shouldn''t be underestimated," he said.\r\n\r\nThe BBC''s Andrew Harding, reporting from near Guiuan, says that after earlier problems with looting, some supplies are now getting in.', '', '', 'en', 1, 0, 'http://nyut.am/disk/15-11-13/95b0d36e8977b79e0c59e8640f28e82c.jpg', '', '', 0, 0, 0, 0, '2013-11-15 10:20:44', '2013-11-15 10:20:44', 3),
(9, 'DNA hint of European origin for dogs', 'The results of a DNA study suggest that dogs were domesticated in Europe.\r\nNo-one doubts that "man''s best friend" is an evolutionary off-shoot of the grey wolf, but scientists have long argued over the precise timing and location for their emergence, BBC reports.\r\n\r\nThe new research, based on a genetic analysis of ancient and modern dog and wolf samples, points to a European origin at least 18,000 years ago.\r\n\r\nOlaf Thalmann and colleagues report the investigation in Science magazine.\r\n\r\nIt adds a further layer of complexity to the story.\r\n\r\nEarlier DNA studies have suggested the modern pooch - in all its shapes and sizes - could track its beginnings back to wolves that attached themselves to human societies in the Middle East or perhaps in East Asia as recently as 15,000 years ago.\r\n\r\nThe problem with these claims is that palaeontologists have found fossils of distinctly dog-looking animals that are 30,000 years old or more.\r\n\r\nDr Thalmann, from Finland''s University of Turku, and his team, have had another go at trying to sort through the conflicting DNA evidence.\r\n\r\nThey compared genetic sequences from a wide range of ancient animals - both dogs and wolves - with material taken from living canines - again, from both dogs and wolves.\r\n\r\nThis analysis reveals modern dogs to be most closely related to ancient European wolves or dogs - not to any of the wolf groups from outside Europe, nor even to modern European wolves (suggesting the link is with old European wolves that are now extinct). And because the dog remains used in the research are dated to be more than 18,000 years old, it indicates a timing for domestication that is much older than some researchers have previously argued.\r\n\r\nIf correct, it means dogs started to diverge from wolf populations when humans had yet to settle into fixed, agricultural communities and were still hunting and gathering.', '', '', 'en', 1, 0, 'http://nyut.am/disk/15-11-13/74c2fd7fb001ab2f7d9036725d877bcf.jpg', '', '', 0, 0, 0, 0, '2013-11-15 11:00:44', '2013-11-15 11:00:44', 3),
(10, 'Venezuela''s President Maduro moves nearer to decree powers', 'Venezuela''s National Assembly has paved the way to granting special powers for President Nicolas Maduro.\r\nUnder the measures the leader would be able to govern by decree for 12 months, BBC reports.\r\n\r\nThe bill still needs to be revised by a special commission and debated for a second time, but correspondents do not expect significant changes to be made.\r\n\r\nMr Maduro says he will use it to tackle corruption and the economic crisis. However, critics fear he may use it to silence the opposition.\r\n\r\nThe approval of the first reading of the bill comes after a member of parliament, Maria Aranguren, who defected to the opposition was stripped of her parliamentary immunity on Tuesday, being replaced by a government loyalist.\r\n\r\nThis provided the one remaining vote that the government was missing to achieve the 99 votes needed for the approval of the "Ley Habilitante", or Enabling Act.', '', '', 'en', 1, 0, 'http://nyut.am/disk/15-11-13/f711010263aeb2827a3be0eade73c22b.jpg', '', '', 0, 0, 0, 0, '2013-11-15 11:20:37', '2013-11-15 11:20:37', 3),
(11, 'OPCW to make decision on Syrian authorities’ chemical weapons liquidation plan', 'The Executive Council of the Organization for the Prohibition of Chemical Weapons (OPCW) on Friday will take a decision on the Syrian authorities’ plan of elimination the country’s chemical weapons’ stockpiles, Itar-Tass reports.\r\n\r\nDamascus officials had previously submitted a detailed plan specifying where and when the chemical weapons’ stockpiles the total volume of which is estimated at 1,000 tonnes, would be destroyed. The elimination of the country’s chemical weapons’ stockpiles is planned to be completed by the middle of next year.\r\n\r\nOPCW Director-General Ahmet Uzumcu on November 5 said that the plan for the destruction of Syrian chemical weapons’ stockpiles outside the country, presented by Syria, “is the most feasible option” in an armed conflict conditions. He said that Syria had met the deadlines — October 27 and November 1, respectively, for the completion of facilities’ inspections and disabling of all the declared chemical weapons production equipment. Inspectors of the OPCW - United Nations mission have inspected 21 of 23 facilities declared by Syria. Two facilities were too dangerous to visit, but the equipment for the production of chemical weapons had been removed from there. The inspectors later could watch one of them using special cameras.', '', '', 'en', 1, 0, 'http://nyut.am/disk/15-11-13/37df9bf07473307b3586b462ba1aeaaa.jpg', '', '', 0, 0, 0, 0, '2013-11-15 11:40:28', '2013-11-15 11:40:28', 3),
