(20, '''Kangaroo care'' key for premature babies', 'Mothers carrying babies skin-to-skin could significantly cut global death and disability rates from premature birth, a leading expert has said.\r\nProf Joy Lawn says "kangaroo care", not expensive intensive care, is the key, BBC reports.\r\n\r\nThe 15 million babies every year born at or before 37 weeks gestation account for about 10% of the global burden of disease, and one million of them die.\r\n\r\nOf those who survive, just under 3% have moderate or severe impairments and 4.4% have mild impairments.\r\nProf Lawn, from the London School of Hygiene and Tropical Medicine (LSHTM), said: "The perception is you need intensive care for pre-term babies,\r\n"But 85% of babies born premature are six weeks early or less. They need help feeding, with temperature control and they are more prone to infection.\r\n\r\n"It''s really only before 32 weeks that their lungs are immature and they need help breathing,\r\n\r\nShe added: "Unless there are those breathing problems, kangaroo care is actually better because it promotes breastfeeding and reduces infection."\r\n\r\nSpeaking ahead of World Prematurity Day on Friday, UN Secretary General Ban Ki-moon, who leads the Every Woman Every Child movement, which promotes improvements to healthcare for women and children, said: "Three-quarters of the one million babies who die each year from complications associated with prematurity could have been saved with cost-effective interventions, even without intensive care facilities."', '', '', 'en', 1, 0, 'http://nyut.am/disk/15-11-13/58867b682747a8791744adb969e20ecc.jpg', '', '', 0, 0, 0, 0, '2013-11-15 12:00:43', '2013-11-15 12:00:43', 3),
(21, 'Զարուհի Փոստանջյանի բողոքի դատական քննությունը. Ժառանգություն', 'Երևանի Մաշտոցի պողոտայի սկզբնամասում գտնվող  հուշարձանի` «Ծածկած շուկայի» ապօրինի քանդման և շինարարական աշխատանքների իրականացման վերաբերյալ ամիսներ առաջ ՀՀ ԱԺ  «ժառանգություն» խմբակցության պատգամավոր Զարուհի Փոստանջյանի կողմից ներկայացված հաղորդումը հանցագործության մասին ՀՀ իրավապահ մարմինների կողմից օրենքով սահմանված կարգով ընթացք չի ստացել: Հուշարձանը քանդողը և պաշտոնատար անձը, ովքեր պատասխանատու են հուշարձանի պահպանման համար, պատասխանատվության չեն կանչվել:\r\nՀՀ իրավապահ մարմինների կողմից  դրսևորած անգործությունը  վիճարկվում է Երևանի Կենտրոն և Նորք-Մարաշ վարչական շրջանների ընդհանուր իրավասության դատարանում:\r\nԳործի քննության ժամանակ ի հայտ են եկել հետևյալ փաստերը` 1.Ճարտարապետահատակագծային առաջադրանք 08.08.2012թ / պահանջ՝ մշակել ‹‹Ծածկած շուկայի›› վերակառուցման ստորգետնյա հարկերի իրականացման նախագիծ/:\r\n2.Շինարարության  թույլտվություն /ձևաթուղթ/՝ բացակայում է հիմք հանդիսացող նախագիծը:\r\n3.Քանդման թույլտվությունը բացակայում է՝ գործում առկա է մի ձևաթուղթ, որտեղ նշված չէ քանդման ենթակա օբյեկտը:\r\n4.Տեսչական ստուգում՝ սկզբնականը բացակայում է:\r\nԳործում առկա է շինարարական կապալի պայմանագիր 01.09.2012թվական ‹‹Թիվ 1 շուկայի›› և ‹‹Լուսարբիլդ›› ՍՊԸ-ի կողմից կնքված, սակայն բացակայում է այն շինարարական լիցենզիան, որի համաձայն այդ կազմակերպությունը կարող է կատարել պատմամշակութային հուշարձանի վերանորոգման աշխատանքներ:\r\nՀամադրելով շինարարության թույլտվության օրենքով սահմանված պահանջները՝ գործում առկա փաստաթղթերի հետ ակնհայտ է դառնում  ՀՀ ոստիկանության կողմից ո´չ բազմակողմանի, ո´չ լրիվ և ո´չ օբյեկտիվ քննությունը:\r\nՄասնավորապես, գործում բացակայում են շինարարությունը իրականացնելու համար հիմք հանդիսացող շինարարության թույլտվությունը (տե´ս՝ կից ներկայացված փաստաթղթի պատճեն՝ թիվ 1), որը տրվում է տվյալ օբյեկտի նախագծային փաստաթղթերի հիման վրա: Չկա նաև քանդման թույլտվությունը (տե´ս՝ կից ներկայացված փաստաթղթի պատճեն՝ թիվ 2), գործում առկա է միայն ձևաթուղթ, որտեղ նշված չէ քանդման ենթակա օբյեկտները:\r\nՉունենալով համապատասխան օրինական փաստաթղթեր՝ կառուցապատողի կողմից ‹‹Ծածկած շուկայի›› տարածքում իրականացվել են մեծածավալ հողային քանդման, տեղափոխման աշխատանքներ և կոնստրուկտիվ միջամտությունները հանգեցրել են կառույցի հիմքերի վնասմանն ու խարխլմանը: Ստորգետնյա հարկերի իրականացման նախագծով նախատեսված՝ դեպի ստորգետնյա ավտոկայանատեղեր մեքենաների մուտքն ու ելքը ապահովելու համար կատարվել է կամարի հատվածի ապամոնտաժում: Առանց թույլտվության օբյեկտի քանդումն ու շինարարական մոնտաժային աշխատանքների կատարումը հանդիսանում է ինքնակամ գործունեություն և առաջ է բերում գործող օրենսդրությամբ սահմանված պատասխանատվության: Ինչպես նաև, Երևանի քաղաքապետի կողմից տարածքում շինարարական աշխատանքներ իրականացնող ‹‹Լուսարբիլդ›› ՍՊԸ-ին համապատասխան թույլտվություն տրամադրելուց հաշվի չի առնվել ‹‹Պատմության և մշակույթի անշարժ հուշարձանների ու պատմական միջավայրի պահպանության և օգտագործման մասին›› ՀՀ օրենքի 32-րդ հոդվածը, որը սահմանում է՝ «Հուշարձանների ամրակայման, նորոգման և վերականգնման աշխատանքները իրականացնում են մասնագիտացված կազմակերպությունները և այն մասնագետները, որոնք ունեն համապատասխան լիցենզիա և տվյալ հուշարձանում աշխատանքներ կատարելու համար սահմանված կարգով տրված թույլտվություն»: Հետևաբար, լիազորված մարմնի կողմից հատուկ քննարկման ենթակա էր հուշարձանի կառույցի տարածքում ‹‹Լուսարբիլդ›› ՍՊԸ-ի կողմից ամրակայման, նորոգման և վերականգնման բնագավառում վերջինիս փորձի և համապատասխան լիցենզիայի բացակայությունը:\r\nՍույն գործով 2013 թվականի նոյեմբերի 15-ին, ժամը 16:00-ին, Երևանի Կենտրոն և Նորք-Մարաշ շրջանների ընդհանուր իրավասության առաջին ատյանի դատարանում (հասցեն՝ ք. Երևան, Տիգրան Մեծի պողոտա 23/1) նախագահող դատավոր Գ.Պողոսյանը կշարունակի հետաձգված դատական քննությունը:\r\n\r\nԺառանգություն', '', '', 'am', 1, 0, 'http://nyut.am/disk/15-11-13/49a4f0fe0f65df1b576452affd3adfbc.jpg', '', '', 0, 0, 0, 0, '2013-11-15 12:20:11', '2013-11-15 12:20:11', 5),
(22, '«Հայ-ռումինական մշակութային ժառանգություն». գիտաժողով Բուխարեստում', ' Հայատանի Հանրապետության և Ռումինիայի Հանրպետության Մշակույթի նախարարությունների, Ռումինիայում Հայաստանի դեսպանության, Ռումինիայի ակադեմիայի կազմակերպմամբ և Հայատանի Հանրապետության և Ռումինիայի Հանրապետության արտգործնախարարությունների հավանությամբ, Ռումինիայի Հայոց միության և Ռումինահայ թեմի աջակցությամբ հոկտեմբերի 30-31-ը Բուխարեստում, Ռումինիայի ազգային գրադարանի Մեծ սրահում կայացել է ռումինահայ մշակութային ժառանգությանը նվիրված «Հայ-ռումինական մշակութային ժառանգություն» խորագրով միջազգային գիտաժողովը: «Սա ՀՀ Մշակույթի նախարարության կողմից որդեգրված մի քաղաքականություն է, որով մենք մեր միջազգային գործընկերային պայմանագրերի միջոցով, փորձում ենք այլ երկրների հայկական մշակութային ժառանգությունը վեր հանել, ցուցադրել: Այս նախագիծը նպատակ է հետապնդում ցույց տալ, որ մեր մշակութային ժառանգությունն աշխարհասփյուռ է, և դա անել 2015-ի Հայոց Ցեղասպանության 100 ամյակին ընդառաջ»,-այսօր այս թեմայով նվիրված ասուլիսին ասաց Մշակույթի նախարարի տեղակալ Արթուր Պողոսյանը: ԵՊՀ Հայ արվեստի պատմության ՅՈՒՆԵՍԿՕ-ի ամբիոնի վարիչ Լևոն Չուքասզյանն, ով մասնակցել է Բուխարեստի գիտաժողովին, ասում է, որ մեզ համար Ռումինիայի հայ մշակույթի ուսումնասիրությունը հատուկ կարևորություն ունի, որովհետև հայ ժողովուրդը դարեր շարունակ իր ներդրումն է ունեցել այս երկրներում: «Մեր երկրի թանգարաններում հավաքվածը մի փոքր մասն է մեր մշակույթի ու արվեստի: Հայերն ուր գնացել են, իրենց հետ տարել են իրենց գրքերը, զարդերը, խաչքարներ են քանդակել, անգամ՝ հիմնել են քաղաքներ, ինչպես Ռումինիայում Արմենապոլիսը»,-ասում է Լևոն Չուքասզյանը: Գիտաժողովի մասնակիցներն ահազանգում են, որ ասիմիլյացիայի վտագն այնտեղ արդեն շատ տեսանելի է. «Եթե մենք մի տասնամյակ էլ ուշացնենք նման գործերը, այլևս հայախոս հայեր չեն մնա այնտեղ, որովհետև շատերն այնտեղ չգիտեն մայրենի լեզուն, պատմությունը, մշակույթը»,-ասում է Չուքասզյանը: Ռումինիայի «Հայ-ռումինական մշակութային ժառանգություն» գիտաժողովին հնչել է 30 ելույթ, որից միայն տասն են Հայաստանից գնացած մասնակիցներինը եղել: «Հոսանքը Անիից դեպի Ղրիմ, Հետո Հունգարիա և Ռումինիա շարասյունով տարել է մարդկանց, ովքեր գնացել ու իրենց հետ տարել են հայ մշակույթն ու պատմությունը»,-ասում է Լևոն Չուքասզյանը: Գիտաժողովի մյուս մասնակից Հայաստանի գիտությունների ակադեմիայի գրականության ինստիտուտի փոխտնօրեն Վարդան Դևրիկյանը փաստում է, որ հայերը իրենց ներկայությամբ ներթափանցել են նաև Ռումինիայի կյանքի մեջ՝ իրենց սովորույթներով ու ավանդույթներով: Դրա վառ օրինակներից մեկը իրենց կողմից չընդունված մատաղի կիրառումն է ռումինացիների կողմից: Ռումինիայում հայկական մշակութային ժառանգության ուսումնասիրության պարագան բացառիկ է, որովհետև Ռումինիայի մայր տաճարի հայոց գանձերը աննախադեպ ծավալի են: «Աստված տա հնարավորություն լինի ուսումնասիրել հայկական մշակութային ժառանգությունը նաև այլ երկրներում, որովհետև ամբողջ աշխարհով մենք մեծ մշակութային ներդրումներ ունենք»,-ասաց Լևոն Չուքասզյանը: Մշակույթի փոխնախարարն ասում է, որ այս մակարդակի և այս խորության գիատաժողով կազմակերպելը շատ դժվար էր և իրենք երկար պատրաստվում էին դրան: «Միջոցառումը շարունակություն է ունենալու, հիմա բանակցություններ ենք վարում, հավանաբար 2015-ին այնտեղ կունենանք ցուցադրություն: Այսպիսի պայմանավորվածություններ ունենք նաև Հնդկաստանի, Լեհաստանի և Ռուսաստանի հետ&gt;&gt;,-ասաց Արթուր Պողոսյանը:', '', '', 'am', 1, 0, 'http://nyut.am/disk/15-11-13/11d484483121a297be53f26788522c4c.jpg', '', '', 0, 0, 0, 0, '2013-11-15 12:02:08', '2013-11-15 12:02:08', 5),
