(24, 'ԱԺ արտահերթ նիստը կկայանա՞', 'Աժ ճեպազրույցի ժամանակ Արմեն  Ռուստամյանը հայտարարեց, որ ԱԺ-ի արտահերթ նիստը կայանալու հարցում թերահավատ է, և կարծում է, թե ՀՀԿ-ն ամեն ինչ կանի խոչնդոտելու համար ԱԺ արտահերթ նիստի կայացմանը: Հիշեցնենք, որ ԱԺ արտահերթ նիստը սպասվում է այսօր ժամը 12-ին:', '', '', 'am', 1, 0, 'http://nyut.am/disk/15-11-13/b76d1c86178db388619dd03f73b5043d.jpg', '', '', 0, 0, 0, 0, '2013-11-15 11:53:54', '2013-11-15 11:53:54', 4),
(25, 'Եգիպտոսը նորից վերադառնում է ռուսական զենքին', 'Ինչպես տեղեկացնում է «vedomosti.ru»-ն, նոյեմբերի 13-14-ը Կահիրեում կայացած ռուս-եգիպտական «2 + 2» ֆորմատով հանդիպումների ժամանակ երկու երկրների միջև ռազմա-տեխնիկական համագործակցության ակտիվացման հարցը քննարկումների առանցքային թեման էր: ՌԴ ԱԳՆ և ՊՆ ղեկավարներ Սերգեյ Լավրովի և Սերգեյ Շոյգուի՝ իրենց եգիպտական գործընկերների հետ հանդիպման գլխավոր արդյունքը, թերևս, այն էր, որ նախնական համաձայնություն ձեռք բերվեց Եգիպտոսին մոտ 2 մլրդ դոլարի չափով ռուսական սպառազինության տրամադրման վերաբերյալ:\r\n\r\nԻնչպես հանդիպման վերջում նշեց Սերգեյ Շոյգուն, «մենք քննարկել ենք ռազմական և ռազմա-տեխնիկական համագործակցության վերաբերյալ նախագծեր և պայմանավորվել, որ մոտ ժամանակներում կձեռնարկենք քայլեր՝ մեր համաձայնությունները իրավաբանորեն ձևակերպելու ուղղությամբ»:', '', '', 'am', 1, 0, 'http://nyut.am/disk/15-11-13/ba8c212f469ada870fc80012e0623d6a.jpg', '', '', 0, 0, 0, 0, '2013-11-15 22:40:05', '2013-11-15 22:40:05', 7),
(26, 'СК проверяет сообщения СМИ о махинациях с недвижимостью народного артиста Алексея Баталова ', '', '', '', 'ru', 1, 0, '', '', '', 0, 0, 0, 0, '2013-11-15 15:06:35', '2013-11-15 15:06:35', 6),
(27, 'Սիրիան չպետք է վերածվի «Ալ-Քաիդայի» ապաստանի. Սպիտակ տուն', 'Ինչպես տեղեկացնում է ITAR-TASS-ը, նոյեմբերի 14-ին ԱՄՆ նախագահի՝ Ազգային անվտանգության հարցերով օգնական Սյուզան Ռայզը հայտարարել է, թե սիրիական ընդդիմությունը պետք է հասկանա, որ ոչ ոք չի հաղթելու Դամասկոսում պետական իշխանության ինստիտուտների կոլապսից: Նախագահի օգնականը հաստատել է, որ ԱՄՆ ադմինիստրացիայի տեսանկյունից, «Սիրիայի ներքին հակամարտությունը ռազմական լուծում չունի, և որ սիրիացիները չեն ունենա կենսունակ ապագա այնքան ժամանակ, քանի դեռ Ասադը մնում է իշխանության գլխին»: Այդ իսկ պատճառով էլ, ըստ Ռայզի, «Ասադին սատարողները պետք է գիտակցեն, որ հակամարտության շարունակությունը կհանգեցնի միայն այն բանին, որ Սիրիան ապաստանի կվերածվի «Ալ-Քաիդայի» և նմանատիպ ծայրահեղական խմբավորումների համար »:', '', '', 'am', 1, 0, 'http://nyut.am/disk/15-11-13/6fff9ffbeb6783d6b6f729e7f876a096.jpg', '', '', 0, 0, 0, 0, '2013-11-15 22:08:38', '2013-11-15 22:08:38', 7),
(28, 'Բելառուսը «մի ոտքով» Առևտրի համաշխարհային կազմակերպությունում է', 'Ինչպես հայտնում է ITAR-TASS-ը, նոյեմբերի 15-ին Բելառուսի նախագահ Ալեքսանդր Լուկաշենկոն հայտարարել է, որ հանրապետությունը կանգնած է Առևտրի համաշխարհային կազմակերպությունը (ԱՀԿ) մուտք գործելու շեմին:\r\n\r\n«Մեզ բարդ ժամանակներ են սպասում նաև տնտեսության ոլորտում: Մենք Մաքսային միության անդամ ենք, ինչին կարելի է ծափահարել, սակայն պետք չէ մոռանալ, որ այդ առումով տնտեսության մեջ ուժեղանում է մրցակցությունը առաջին հերթին երեք պետությունների միջև, իսկ այդ մրցակցությունը իր որոշակի հետքը կթողնի մեր ողջ հետագա գործունեության վրա»,- ասել է նա:\r\n\r\nՆախագահի խոսքերով, Միասնական տնտեսական տարածքի նորմերի մշակմամբ, դրա մասնակիցները փաստացի ընդունել են ԱՀԿ-ի նորմերը:\r\n\r\n ', '', '', 'am', 1, 0, 'http://nyut.am/disk/15-11-13/6e9f656b305456d9a3a7dddf5114880c.jpg', '', '', 0, 0, 0, 0, '2013-11-15 20:48:47', '2013-11-15 20:48:47', 7),
(29, 'Ռուս-վրացական փոխադարձ պարտավորությունները 80 տոկոսով կատարվել են', 'Ինչպես տեղեկացնում է rosbalt.ru-ն, Վրաստանի վարչապետի՝ Ռուսաստանի հետ հարաբերությունների հարցերով  ներկայացուցիչ Զուրաբ Աբաշիձեն, խոսելով ՌԴ արտաքին գործերի նախարարի տեղակալ Գրիգորի Կարասինի հետ, այն միտքն է հայտնել, թե ռուս-վրացական բանակցությունների ֆորմատը 2013 թ. ընթացքում թույլ է տվել օրակարգը իրականացնել մոտ 80%-ով: Նա նաև նշել է, որ երկու երկրների միջև գրեթե վերականգնվել են առևտրային կապերը՝ իրենց ողջ նախնական ծավալով: Բացի այդ նախատեսվում է, որ մոտ ժամանակներս կվերականգնվի նաև ավտոմոբիլային հաղորդակցությունը:\r\n\r\nԸստ Վրաստանի վարչապետի հատուկ ներկայացուցչի՝ օրակարգում մնացած հարցերի 20%-ը վերաբերվում էր երկու երկրների միջև վիզային համակարգի վերացմանը:\r\n\r\nՀաղորդվում է, որ Զուրաբ Աբաշիձեն և Գրիգորի Կարասինը Պրահայում կայանալիք բանակցությունների ընթացքում կորոշեն 1 տարվա համատեղ աշխատանքի արդյունքները:', '', '', 'am', 1, 0, 'http://nyut.am/disk/15-11-13/2e8a4665d5aef564ec1b05e6b341fdd8.jpg', '', '', 0, 0, 0, 0, '2013-11-15 21:52:17', '2013-11-15 21:52:17', 7),
(30, 'Լիբիան ուզում է անցնել շարիաթի օրենքներին', 'Ինչպես հաղորդում է «Al Arabiya»-ն, Լիբիայում ստեղծել են հանձնաժողով, որը երկրի օրենսդրությունը պետք է ձևափոխի իսլամիստական ոգով: Այս հանձնաժողովը կզբաղվի գործող օրենքների վերամշակամբ, որպեսզի դրանք համապատասխանեն շարիաթի իսլամական օրենքներին:\r\n\r\nՀանձնաժողովում կլինի 16 մարդ, որոնց թեկնածությունները պետք է հաստատի Գերագույն դատարանը և մուֆտին: Իսկ արդյունքում՝ հանձնաժողովի կողմից ընդունված փոփոխությունները պետք է ընդունի լիբիական խորհրդարանը:', '', '', 'am', 1, 0, 'http://nyut.am/disk/16-11-13/893202012bdbe9a08d770ecd12179b5e.jpg', '', '', 0, 0, 0, 0, '2013-11-16 01:23:17', '2013-11-16 01:23:17', 7),
(31, 'Մադուրոն հատուկ լիազորություններ է ստանում', 'Ինչպես տեղեկացնում է «France-Presse»-ը, նոյեմբերի 14-ին Վենեսուելայի Ազգային ասամբլեան առաջին ընթերցմամբ ընդունել օրինագիծ, որով երկրի նախագահ Նիկոլաս Մադուրոյին տրամադրվում են հատուկ լիազորություններ, որոնք անհրաժեշտ են կոռուպցիայի և Վենեսուելայի անվտանգությանը սպառնացող տնտեսական պատերազմի դեմ պայքարելու համար:\r\n\r\nՕրինագծին կողմ են քվեարկել 165 պատգամավորներին 99-ը՝ հենց այդքան ձայն էր պետք խորհրդարանի կողմից նախաձեռնությունը հաստատելու համար:\r\n\r\nԻնչպես նշել է խորհրդարանի խոսնակ Դիոսդադո Կաբելյոն, խորհրդարանը վերջնականապես կհաստատի օրինագօծը նոյեմբերի 19-ին:', '', '', 'am', 1, 0, 'http://nyut.am/disk/16-11-13/e224d1f02e36e0a962249a9c98e8f8f3.jpg', '', '', 0, 0, 0, 0, '2013-11-16 00:33:20', '2013-11-16 00:33:20', 7),
(32, 'Վրաստանում արդարացվել են նախկին նախարարներ', 'Ինչպես տեղեկացնում է «lenta.ru»-ն, նոյեմբերի 14-ին Թբիլիսիի դատարանն արդարացրել է մի խումբ նախկին բարձրաստիճան պաշտոնյաների, որոնք մեղադրվում էին կաշառակերության մեջ:\r\n\r\nԴատարանն անմեղ է ճանաչել կրթության նախկին նախարար և «Ռուսթավի-2» հեռուստաընկերության գլխավոր տնօրեն Նիկա Գվարամիային, էկոնոմիկայի նախկին փոխնախարար Կախա Դանեբիային, էներգետիկայի նախկին նախարար Ալեքսանդր Խետագուրիին, «Թելասի» էներգաբաշխիչ ընկերության գլխավոր տնօրեն Դևի Կանդելակիին, «Էլենդեֆ սերվիս» ընկերության հիմնադիր Գիորգի Նեմսիցվերիձեին, ինչպես նաև Իզաբել Գուտիձեին:\r\n\r\nՆույն գործով մեղադրվող Աշոտ Մանուկյանը մեղավոր է ճանաչվել և դատապարտվել ազատազրկման, սակայն այժմ նա թաքնվում է հետաքննությունից և գտնվում հետախուզման մեջ:\r\n\r\nՊաշտոնյաները ձերբակալվել էին 2012թ. դեկտեմբերին, Վրաստանում իշխանափոխությունից հետո: Նրանց կաշառակերության և փողերի լվացման մեղադրանքներ էին ներկայացվել: Բոլոր ձերբակալվածները հրաժարվել էին ընդունել իրենց մեղքը, հետագայում գրավի դիմաց ազատ էին արձակվել մինչ դատալսումները:', '', '', 'am', 1, 0, 'http://nyut.am/disk/15-11-13/47c23a40d3e8d814ceb3c5185a49ae47.jpg', '', '', 0, 0, 0, 0, '2013-11-15 14:10:14', '2013-11-15 14:10:14', 7),
(33, 'Օրերս Էրդողանը կհանդիպի Պուտինի հետ', 'Ինչպես հայտնում է «Todays Zaman»-ը, նոյեմբերի 21-ին Թուրքիայի վարչապետ Ռեջեփ Թայիբ Էրդողանը պաշտոնական այցով կմեկնի Ռուսաստան:\r\nՀաղորդվում է, որ օրակարգում կլինեն տարածաշրջանային և միջազգային հարաբերություններին առնչվող հարցեր:\r\nԷրդողանին կուղեկցեն էներգետիկայի և բնական պաշարների նախարար Թաներ Յըլդըզը, էկոնոմիկայի նախարար Զաֆեր Չագլայանը և արտգործնախարար Ահմեդ Դավութօղլուն, ովքեր կմասնակցեն ռուս-թուրքական համագործակցության խորհրդի բարձր մակարդակով 4-րդ հանդիպմանը:\r\nԾրագրվում է նաև Էրդողանի առանձին հանդիպումը Ռուսաստանի նախագահ Վլադիմիր Պուտինի հետ, որի ընթացքում կքննարկվեն Սիրիայում տիրող իրավիճակը, Իրանի միջուկային ծրագիրն ու իրադարձությունները Եգիպտոսում:', '', '', 'am', 1, 0, 'http://nyut.am/disk/15-11-13/e0f7aad885d0239fb69ce5a74735df5d.jpg', '', '', 0, 0, 0, 0, '2013-11-15 13:16:16', '2013-11-15 13:16:16', 7),
(34, 'Վրաստանում էլ են գտնում, որ արտագաղթի չափերն իրենց մոտ աղետալի են', 'Ինչպես փոխանցում է «Km.ru»-ն, Թբիլիսիում անցկացված միգրացիոն խնդիրներին նվիրված միջազգային համաժողովի ժամանակ Վրաստանի սփյուռքի հարցերով նախարար Կոնստանտին Սուրգուլաձեն հայտարարել է, թե անկախության 22 տարիների ընթացքում Վրաստանը լքել է շուրջ 1.5 մլն մարդ:\r\n\r\nՍուրգուլաձեն իր ելույթի ժամանակ հիշեցրել է, որ Վրաստանի բնակչությունը կազմում է մոտ 4.3 մլն մարդ: Հաշվի առնելով այն հանգամանքը, որ 1989 թվականին անցկացված մարդահամարի տվյալներով երկրում գրանցված է եղել 5.4 մլն բնակիչ, ստացվում է, որ ինքնիշխանության ձեռք բերումից հետո երկիրը լքել է բնակչության քառորդ մասը: Ըստ նրա, այդ բացասական ցուցանիշով երկիրը կարելի է համարել աշխարհում առաջատարներից մեկը:', '', '', 'am', 1, 0, 'http://nyut.am/disk/16-11-13/9ece0d4fc91e978cfeb8bfdf55b896a2.jpg', '', '', 0, 0, 0, 0, '2013-11-16 09:36:40', '2013-11-16 09:36:40', 7),
(35, 'Մադուրոն՝ 1920-ականների բոլշևիկյան սցենարներով', 'Ինչպես հայտնում է «polit.ru»-ն, հղում անելով «The Buenos Aires Herald»-ին,  Վենեսուելայում երկրի նախագահ Նիկոլաս Մադուրոյի հրամանով ձերբակալվել է ավելի քան 100 «բուրժուա ձեռնարկատեր»: Բոլոր նրանք մեղադրվում են սպեկուլյացիայի մեջ:\r\n\r\nՆախագահը նշել է, որ իր կառավարությունը պատրաստում է նոր կանոններ՝ ձեռնարկատերերի եկամուտները սահմանափակելու ուղղությամբ, որոնցով ընկերության եկամուտները չպետք է գերազանցեն 15-30 տոկոսը: Սակայն, ըստ Մադուրոյի, որոշ ապրանքների գները, առաջին հերթին՝ կենցաղային տեխնիկային վերաբերող, ձեռնարկատերերը բարձրացնում են մինչև 1000 տոկոս:\r\n\r\nԻնչպես մեր կայքում տեղեկացրել ենք, օրեր առաջ Մադուրոն դիմել էր ուժայինների միջամտությանը, որոնք պետք է որոշ խանութներում վերահսկեին «արդար գներով» վաճառքը:', '', '', 'am', 1, 0, 'http://nyut.am/disk/15-11-13/1fed0446522700dc5d4e93631bd4ca5c.jpg', '', '', 0, 0, 0, 0, '2013-11-15 23:28:31', '2013-11-15 23:28:31', 7);
