(36, 'ՔԶԱԿ-ը կներկայացնի վերջնական «պարտքուպահանջը»', 'Ինչպես հայտնում է «polit.ru»-ն, նոյեմբերի 15-ին Քիմիական զենքի արգելման կազմակերպությունը (ՔԶԱԿ) հաստատել է քիմիական զենքի ոչնչացման Սիրիայի պլանը:\r\n\r\nԱմենակարևոր հարցերից մեկը այդ զենքի ոչնչացման համար անհրաժեշտ ֆինանսավորումն է: Միջոցների հայթայթմամբ զբաղվող ՄԱԿ հիմնադրամը հավաքել է մոտ 2 մլն եվրո:\r\n\r\nՆոյեմբերի 15-ին ՔԶԱԿ-ը պետք է ներկայացնի ֆինանսավորման վերջնական պլանը:', '', '', 'am', 1, 0, 'http://nyut.am/disk/15-11-13/c8c6c1cf331181cc395ca83c66268486.jpg', '', '', 0, 0, 0, 0, '2013-11-15 21:36:29', '2013-11-15 21:36:29', 7),
(37, 'Դիլիջանում կանցկացվի ևս մեկ «Բիզնես ինովացիոն ֆորում»', 'Նոյեմբերի 29-ից դեկտեմբերի 1-ը Դիլիջանում առաջին անգամ կանցկացվի «Բիզնես ինովացիոն ֆորում» միջոցառումը` Ինֆորմացիոն տեխնոլոգիաների ձեռնարկությունների միության կազմակերպմամբ:\r\nՀՀ էկոնոմիկայի նախարար Վահրամ Ավանեսյանն այսօր հրավիրված մամլո ասուլիսին նշեց, որ տեղեկատվական տեխնոլոգիաների ոլորտը, ունենալով աճի բավականաչափ արագ տեմպեր, հիմնականում ուղղված է արտահանմանը. «Տեղական ձեռնարկությունները դեռ բավականաչափ ինֆորմացիայի կարիք ունեն` հասկանալու համար, թե այս ոլորտի ապրանքներն ու ծառայություններն ինչպես կարող են օգտագործել սեփական արտադրողականությունը, մրցունակությունն ավելացնելու համար»,- նշեց նախարարը:\r\nԸստ այդմ՝ ֆորումի հիմնական նպատակը գործարար կապերի հաստատումն է, փոխադարձ հնարավորությունների գնահատումը: Նախարարի խոսքով՝ ակնկալվում է, որ շուրջ 60 մասնագիտացված և այլ ոլորտների 100-ից ավել ընկերություններ կմասնակցեն ֆորումին: Արդեն այսօրվանից սկսել են մասնակցության հայտերի գրանցումը:\r\nԻնֆորմացիոն տեխնոլոգիաների ձեռնարկությունների միության գործադիր տնօրեն  Կարեն Վարդանյանի խոսքով,  ՀՀ վարչապետի հովանու ներքո ամեն տարի անցկացվում է «Դիջիթեք» ֆորումը, և հարց է առաջանում, թե ոլորտում ինչու է պետք նույն խնդիրը լուծող երկրորդը: «Առաջինի ժամանակ մի թերություն կա, այն է` բավարար միջավայր չենք ապահովում, որպեսզի տեխնոլոգիական բիզնեսն ու այլ ոլորտների բիզնեսները շփվեն, այսինքն` ստեղծվի մարդկային վստահության մթնոլորտ և հարաբերություններ, որոնք կնպաստեն խնդիրների լուծմանը»,- նշեց նա` հավելելով, որ այս երկրորդ ֆորումով, որը կազմակերպվում է ՀՀ էկոնոմիկայի նախարարության աջակցությամբ, փորձում են այդ խնդիրները լուծել:\r\nԿ. Վարդանյանի խոսքով՝ երեք հիմնական խնդիր են դրել իրենց առջև. մասնակիցները ռեալ կերպով պետք է գտնեն իրենց խնդիրներին լուծումներ, երկրորդ` լրացնեն փորձի փոխանակման լուրջ պակասը և երրորդ` գլոբալ խնդիրների փունջ, օրինակ` Սյուռքի ներգրավումը տեխնոլոգիական զարգացման մեջ, ռեգիոնալ զարգացումը և այլն: Ֆորումին մեծ ուշադրություն է դարձվելու նաև ոչ աշխատանքային շփումներին. կազմակերպվելու են թեմատիկ ճաշկերույթներ, ջազի, ազգայի խոհանոցի և այլ երեկոներ, որոնք մասնակիցներին կօգնեն նաև լավ ճանաչել իրար, ինչու չէ, նաև` ընկերանալ:\r\nՄիջոցառումը կմեկնարկի պլենար նիստով, որին կհաջորդեն գործարար ներկայացումներ և կլոր սեղաններ` բիզնեսի կազմակերպման հետ կապված խնդիրների վերաբերյալ: Կքննարկվեն հետևյալ առանցքային թեմաները` նորարարությունների ներդրման ենթակառուցվածքային և գործարար քաղաքականության հիմնախնդիրներ, ձեռնարկություններում նորարարության ներդրման խնդիրներ, տեխնոլոգիական և նորարարական լուծումներ բիզնեսի մարտահրավերներին դիմակայելու համար:', '', '', 'am', 1, 0, 'http://nyut.am/disk/15-11-13/894eb97f7b4e2e4414dc719d6501cddd.jpg', '', '', 0, 0, 0, 0, '2013-11-15 12:31:00', '2013-11-15 12:31:00', 4),
(38, 'Heinz says three North American plants to close', 'Food maker Heinz has announced the closure of two plants in the United States and one in Canada.\r\nThe firm says 1,350 jobs will be lost, which adds to the 600 job cuts announced in August, BBC reports.\r\n\r\nHeinz was bought in June by Berkshire Hathaway, the investment firm owned by Warren Buffet, for $12.3bn.\r\n\r\nThe cuts total 200 jobs in Florence, South Carolina, 410 jobs in Pocatello, Idaho, and 740 employees in Leamington, Ontario, in Canada.\r\n\r\nProduction will be switched to other plants, which will receive fresh investment and new staff.\r\n\r\nHeinz will employ around 6,800 staff in North America after the changes come into effect.', '', '', 'en', 1, 0, 'http://nyut.am/disk/15-11-13/71123cd6852f9448b4921f2e80332642.jpg', '', '', 0, 0, 0, 0, '2013-11-15 12:40:27', '2013-11-15 12:40:27', 3),
(39, 'Փոխհրաձգություն ամերիկյան հիվանդանոցում՝ իսկը ֆիլմի սցենար', 'Ինչպես հայտնում է «polit.ru»-ն՝ հղում անելով «Fox News»-ին, ԱՄՆ Վիսկոնսին նահանգի ոստիկանները տեղի հիվանդանոցներից մեկում փոխհրաձություն են բացել: Դեպքը տեղի է ունեցել այն բանից հետո, երբ ֆեմիդայի պահապանները հիվանդասենյակներից մեկում նկատել են մարդու, ով գտնվում էր հետախուզման մեջ: Վերջինս փորձել է փախուստի դիմել, իսկ ոստիկաններն էլ կրակ են բացել և  ձերբակալել նրան: Հիվանդներն ու ոստիկանությունը չեն տուժել:', '', '', 'am', 1, 0, 'http://nyut.am/disk/15-11-13/0449f1114853293e913ba97a931ffa5a.jpg', '', '', 0, 0, 0, 0, '2013-11-15 12:40:27', '2013-11-15 12:40:27', 7),
(40, 'Մինչ Ուկրաինան «գցում-բռնում է»՝ եվրոպական բանկերը լքում են երկրի ֆինանսական շուկան', 'Ինչպես հաղորդում է «MIGnews»-ը, Մինչ Եվրախորհրդարանի դիտորդները հույս են հայտնում, որ Ուկրաինան կստորագրի ԵՄ-ի հետ Ասոցացման համաձայնագիրը, եվրոպական բանկերն արդեն կայացրել են իրենց որոշումը` նրանք լքում են ուկրաինական շուկան:\r\n\r\n Այս մասին հայտարարել է «Ուկրաինա. ներդրումային կապիտալ» ընկերության տնօրենների խորհրդի նախագահ Վալերի Գոնտարևը՝ Ադամ Սմիթի անվան ինստիտուտի ամենամյա համաժողովի` Ուկրաինական բանկային ֆորումի շրջանակներում, որն անցկացվում է Կիևում :\r\nԵվրոպական բանկերի հեռանալու հետևանքով փոխվում է Ուկրաինայի ֆինանսական ոլորտը. ուկրաինացիների գումարները կենտրոնանում են միայն տեղի և ռուս բանկիրների ձեռքերում:\r\nՍակայն եվրոպական բանկերի Ուկրաինայից հեռացումն առաջին հերթին նշանակում է, որ այս երկրի եվրաինտեգրման հետ կապված հույսերը դեռևս չեն արդարացվել:', '', '', 'am', 1, 0, 'http://nyut.am/disk/15-11-13/d2941918c04d0e33ea564e1be259aa6a.jpg', '', '', 0, 0, 0, 0, '2013-11-15 15:58:07', '2013-11-15 15:58:07', 7),
(41, 'Հռոմի կինոփառատոնում էլ «անհամություններ» են եղել', 'Ինչպես  հաղորդում է RIA «Novosti»-ն, այս օրերին (նոյեմբերի 8-17-ը) ընթացող Հռոմի միջազգային կինոփառատոնում էլ առանց միջադեպերի գործը գլուխ չի եկել: Ցուցարարները, որոնք բողոքում են Իտալիայի կառավարության դեմ՝ սոցիալական կացարանների ոլորտում տիրող իրավիճակի համար, շրջափակել են կարմիր գորգի ճանապարհը: Մոտ տասը մարդ շարվել է գորգի վրա` իշխանություններին կոչ անելով ուշադրություն դարձնել բնակարանների բաշխման ոլորտում ստեղծված ծայրահեղ իրավիճակին:\r\n\r\n\r\nՑուցարարները մտադիր են եղել փակել «The Hunger Games: Catching Fire» ֆիլմի գլխավոր դերակատար Ջենիֆեր Լոուրենսի ճանապարհը, սակայն ոստիկանությունը մեկուսացրել է շարժման ներկայացուցիչներին:', '', '', 'am', 1, 1, 'http://nyut.am/disk/16-11-13/3c88dc19658b0b815ddcc18967207a9b.jpg', '', '', 0, 0, 0, 0, '2013-11-16 09:22:21', '2013-11-16 09:22:21', 7),
(42, 'Ուկրաինական ապրանքը ԵՄ-ում շուկա չունի. Յանուկովիչ', 'Ինչպես  հաղորդում է RIA «Novosti»-ն, Ուկրաինայի նախագահ Վիկտոր Յանուկովիչը հայտարարել է, որ ուկրաինական արտադրանքը ԵՄ շուկաներում պահանջարկ չունի, իսկ ուկրաինական տնտեսությունն արդիականացնելու համար մեծ ներդրումներ են հարկավոր, որոնք չկան: Նա նաև ասել է, որ չնայած դրան՝ եվրոպական չափորոշիչների ներմուծման քաղաքականությունը երկրում անփոփոխ է:\r\n\r\n «Մենք շատ լավ հասկանում ենք, որ Ուկրաինան պետք է գնա արդիականացման, եվրոպական չափորոշիչները ուկրաինական օրենսդրության հետ ներդաշնակեցնելու ճանապարհով: Այդ ճանապարհը մեզ մոտ անփոփոխ է: Բայց ամենակարևորը ժամանակի փաստն է: Մենք այն այլևս չունենք »,- ասել է Յանուկովիչը՝ հավելելով, որ ցանկացած տիպի արդիականացում ֆինանսավորման կարիք ունի:', '', '', 'am', 1, 0, 'http://nyut.am/disk/15-11-13/682446ad734c10d783cdb96850223060.jpg', '', '', 0, 0, 0, 0, '2013-11-15 15:13:34', '2013-11-15 15:13:34', 7),
(43, 'Վարչապետը հրաժեշտի հանդիպում է ունեցել ՀՀ-ում Իտալիայի դեսպանի հետ', 'Վարչապետ Տիգրան Սարգսյանն ընդունել է Հայաստանում Իտալիայի արտակարգ և լիազոր դեսպան Բրունո Սկապինիին, ով ավարտում է իր դիվանագիտական առաքելությունը մեր երկրում: Կառավարության ղեկավարը բարձր է գնահատել դեսպանի գործունեությունը հայ-իտալական հարաբերությունների ընդլայման և խորացման գործում:\r\nԲրունո Սկապինին շնորհակալություն է հայտնել ՀՀ կառավարությանը սերտ համագործակցության համար և նշել, որ Հայաստանի և Իտալիայի հարաբերություններն այս ընթացքում զարգացել են ինչպես տնտեսական, այնպես էլ մշակութային ու հումանիտար բնագավառներում: ՀՀ-ում Իտալիայի դեսպանը հիշեցրել է, որ այս ընթացքում ստեղծվել է նաև հայ-իտալական առևտրային պալատը, որը հնարավորություն կտա Հայաստան ներգրավել իտալական նոր ընկերություններ և ներդրումներ: Սկապինիի խոսքով՝ տարեցտարի մեծանում է իտալացի զբոսաշրջիկների հոսքը մեր երկիր, ինչը երկու ժողովուրդների կապերի ամրապնդման լավագույն ուղիներից մեկն է:\r\nԲրունո Սկապինին տեղեկացրել է նաև, որ 2015 թվականին Հայոց ցեղասպանության 100-ամյա տարելիցի միջոցառումների շրջանակներում նախատեսվում է Վերոնայում կազմակերպել հայկական երաժշտության մեծ երեկո:\r\nՎարչապետը շնորհակալություն է հայտնել դեսպանին՝ հայ-իտալական հարաբերությունների զարգացմանը նպաստելու համար, և մաղթել նորանոր հաջողություններ հետագա գործունեության մեջ:', '', '', 'am', 1, 0, 'http://nyut.am/disk/15-11-13/47f80b28c7a86c59c315c93a8edc0dbe.jpg', '', '', 0, 0, 0, 0, '2013-11-15 12:49:20', '2013-11-15 12:49:20', 4),
(44, 'Արմեն Պողոսյան. «Մենք ժամանակին արել ենք ստուգում և պարզել, որ մինչև 30% հացի գնի և քաշի կեղծում կա»', ' «Մենք համոզված ենք, որ հացի նոմինալ թանկացումից բացի, կա նաև կրիմինալ թանկացում: Պետք է ստուգումներ արվեն հացի քաշի, որակի և գնի ասպարեզում»,-այսօր լրագրողներին ասաց «Հայաստանի սպառողների միության&gt;&gt; նախագահ Արմեն Պողոսյանը: Բանախոսը տեղեկացրեց, որ իրենք նախագահի ու վարչապետի վերահսկողության ծառայությանը ժամանակին նամակ են ուղարկել այս հարցով, հետո նամակը ուղարկվել է սննդի պետական ծառայություն, ասել են՝ կզբաղվեք: «Սպառողների միությունը, լրագրողների ու սննդի պետական տեսչության հետ, հացը ուղարկում ենք լաբորատոր ստուգման: Սրա համար ոչ մեծ ծախս է պետք, ոչ էլ ժամանակ: Սրանից ավել էլ ինչ առաջնահերթություն կարող է ունենալ սննդի պետական տեսչությունը: Մենք ժամանակին արել ենք ստուգում և պարզել ենք, որ մինչև 30% հացի գնի և քաշի կեղծում կա»,-ասում է Արմեն Պողոսյանը: Հացի սպառման ծավալների նվազումը Արմեն Պողոսյանը կապում է արտագաղթի ծավալների մեծացման հետ. «Արտագաղթը առաջին հերթին քաղաքական հարց է: Մարդկանց կենսամակարդակը արտագաղթի առաջին դրդապատճառն է: Կենսամակարդակը մի օր կբարելավվի, բայց կյանքի որակն այլ ու ավելի կարևոր բան է, որի մասին ոչ ոք չի խոսում»: Խոսելով տրանսպորտի գնի հնարավոր թանկացման մասին՝ Հայաստանի սպառողների միության նախագահն ասում է. «Ես զգում եմ, որ ամեն ինչ գնում է տրանսպորտի թանկացմանը: Մենք դիմադրում ենք, բայց ինչ կունենանք արդյունքում՝ չգիտեմ: Մի անգամ երիտասարդների օժանդակությամբ հաղթեցինք, այս անգամ էլ է պետք և հասարակական, և քաղաքական ակտիվություն»,-ասում է Արմեն Պողոսյանը:', '', '', 'am', 1, 0, 'http://nyut.am/disk/15-11-13/807cdf8185a3b725572b9ad1b5b0e914.jpg', '', '', 0, 0, 0, 0, '2013-11-15 12:58:50', '2013-11-15 12:58:50', 5),
(45, 'Եթե երեք ժամվա ընթացքում քվորում չլինի, ԱԺ նիստը կլուծարվի', ' ԱԺ արտահերթ նիստը սկսված է: Արամ Մանուկյանը լրագրողների հետ ճեպազրույցում նշեց, որ ՕԵԿ-ը և ՀՀԿ-ն բոյկոտել են, և նիստին ոչ ոք չի եկել: Այս պահին արտահերթ նիստին մասնակցում է 45 պատգամավոր, և եթե 3 ժամվա ընթացքում քվորում չապահովվի, նիստը կավարտվի: Nyut.am-ի թղթակցի հարցին, թե` «ՀՀԿ-ից ոմանք ասել են, որ եթե ընդդիմությունը անհրաժեշտ 44 ստորագրահավաք հավաքի, իրենք չեն բոյկոտի, սակայն, այնուամենայնիվ բոյկոտեցին», Արամ Մանուկյանը պատասխանեց, թե զարմանում է իշխանության վախկոտ վերաբերմունքից: «Ի՞նչն էր խանգարում, որ գան, թեկուզ դեմ քվեարկեն, բայց հիմնավորեն, որ իրենք ճիշտ են: Այս պահին Դեմիրճյան փողոցում ցույց է, թող գային և հիմնավորեին, որ իրենք են ճիշտը, իսկ ժողովուրդը չի հասկանում: Սա նշանակում է, որ այդ կուսակցությունը չունի թիմային քաղաքականություն, այլ առաջնորդվում է մեկ անձի կողմից:', '', '', 'am', 1, 0, 'http://nyut.am/disk/15-11-13/f9dffacd4eac7044d82e753dd6f35395.jpg', '', '', 0, 0, 0, 0, '2013-11-15 13:25:40', '2013-11-15 13:25:40', 4),
(46, 'Ջրագծերի անցկացման աշխատանքներ կատարելիս հրետանային արկ է հայտնաբերվել', '\r\nՆոյեմբերի 14-ին, ժամը 11.20-ին,  ՀՀ ԱԻՆ Լոռու մարզի փրկարար ծառայությունից ոստիկանության Տարոնի  բաժնում հաղորդում է ստացվել, որ Վանաձոր քաղաքի թիվ 6 դպրոցի մոտ ական կա:\r\nՄեկնած օպերատիվ խումբը պարզել է, որ Վանաձորի Մոսկովյան փողոցի թիվ 58/4 հասցեի մոտ, ջրագծերի անցկացման աշխատանքներ կատարելիս, ասֆալտի ծածկի տակ հայտնաբերվել է 485 մմ երկարության, 75 մմ տրամաչափի հրետանային արկ:\r\nՆշանակվել է դատաձգաբանական փորձաքննություն:\r\nՀանգամանքները պարզվում են:\r\nԿատարվում է քննություն:', '', '', 'am', 1, 0, 'http://nyut.am/disk/15-11-13/b137ccc345bff30adcd3f5d5b74d10f8.jpg', '', '', 0, 0, 0, 0, '2013-11-15 14:01:29', '2013-11-15 14:01:29', 5),
(47, 'Հակամրցակցային համաձայնության համար «Երեքնուկ», «Ամարաս Յուս» և «Սեար Գրուպ» ընկերություններից յուրաքանչյուրը տուգանվեց 15 մլն դրամով', 'ՀՀ տնտեսական մրցակցության պաշտպանության պետական (ՏՄՊՊ) հանձնաժողովն իր այսօրվա նիստում որոշեց «Երեքնուկ», «Ամարաս Յուս» և «Սեար Գրուպ» ընկերություններից յուրաքանչյուրին տուգանել 15 մլն դրամի չափով: Հանձնաժողովն ուսումնասիրել է 88 հաստատությունների (ծերանոց, մանկատուն, գիշերօթիկ հաստատություն, մանկապարտեզ) կազմակեպած շուրջ 200 մրցութային փաթեթներ, ինչի արդյունքում բացահայտվել է, որ ընկերությունները պետգնումների մրցութային գործընթացների շրջանակներում վարել են համատեղ փոխհամաձայնեցված քաղաքականություն, այսինքն` նրանց միջև եղել է հակամրցակցային համաձայնություն: ՏՄՊՊ հանձնաժողովը հայտնաբերել է վերոնշյալը վկայող մի շարք փաստեր ու հանգամանքներ:\r\n\r\nՀավելենք, որ հիշյալ ընկերություններից երկուսն առաջին անգամը չէ, որ թույլ են տալիս մրցակցային օրենսդրության խախտումներ ու հայտնվում հանձնաժողովի տեսադաշտում: Մասնավորապես` «Սեար Գրուպ» և «Երեքնուկ» ընկերությունները նախորդ տարի ՏՄՊՊ հանձնաժողովի կողմից տուգանվել են, ընդհանուր առմամբ, 15 մլն դրամի չափով` մանկապարտեզներում կազմակերպված մրցույթներում թույլ տված չարաշահումների համար:', '', '', 'am', 1, 0, 'http://nyut.am/disk/15-11-13/9839767cbe577bf2d51e5014927eb2f6.jpg', '', '', 0, 0, 0, 0, '2013-11-15 13:43:05', '2013-11-15 13:43:05', 7),
(48, 'Black Sabbath pick up Classic Rock''s legend award', 'Heavy metal stars Black Sabbath triumphed at this year''s Classic Rock Roll of Honour, picking up three prizes including the living legend award.\r\nThe Birmingham band also won album of the year for 13 and event of the year, after 13 topped album charts worldwide and scored them their biggest US hit, BBC reports.\r\n\r\nPrevious living legend winners include ZZ top, Jimmy Page and Iggy Pop.\r\n\r\nOther winners announced at this year''s London ceremony include Led Zeppelin, The Rolling Stones and Fleetwood Mac.\r\n\r\nFollowing their Hyde Park live shows and a Glastonbury headline set this summer The Rolling Stones were named band of the year, while best new band went to The Temperance Movement.\r\n\r\nManic Street Preachers founding member and guitarist James Dean Bradfield was named winner of the Musicians'' Union Maestro Award.\r\n\r\nLate Irish guitar legend Rory Gallagher was honoured with the Tommy Vance Inspiration Award and The Virginmarys won the Breakthrough Award.\r\n\r\nShep Gordon, manager of Alice Cooper for more than 40 years, was honoured with a special VIP Award.\r\n\r\nThe prize also recognises his work as a film producer and humanitarian, and how he has helped to sculpt the careers of a host of friends in the entertainment industry.\r\n\r\nA documentary film charting Gordon''s career, directed by Mike Myers and entitled SuperMensch: The Legend of Shep Gordon, recently premiered at the Toronto Film Festival.\r\n\r\n"This year''s winners are a who''s-who of British pioneers," said Classic Rock Magazine''s editor-in-chief Scott Rowley.', '', '', 'en', 1, 0, 'http://nyut.am/disk/15-11-13/5a11e72885e1b32e0ee2a3a66d922eee.jpg', '', '', 0, 0, 0, 0, '2013-11-15 13:42:31', '2013-11-15 13:42:31', 3),
(49, 'Լեհաստանում գազատար է պայթել ', 'Ինչպես տեղեկացնում է lenta.ru»-ն՝ հղում անելով լեհական «The Warsaw Voice»-ին, Լեհաստանում գազատարի պայթյունի հետևանքով երկու մարդ է զոհվել, առնվան 13 մարդ՝ վիրավորվել, նրանցից երկուսի վիճակը ծայրահեղ ծանր է: Առաջացած հրդեհից տուժել են տասնյակ բնակելի տներ:\r\n\r\nՄիջադեպի պատճառ է հանդիսացել գազի արտահոսքը, որն առաջացել է գազատարի վնասվելու հետևանքով՝ շինարարական աշխատանքների ընթացքում : Պայթյունի վերջնական պատճառն ու դրա պատճառած հետևանքները կպարզի հատուկ հանձնաժողովը:', '', '', 'am', 1, 0, 'http://nyut.am/disk/15-11-13/12bc8604e37fe569051dff73ecef08f1.jpg', '', '', 0, 0, 0, 0, '2013-11-15 14:28:38', '2013-11-15 14:28:38', 4),
(50, 'PlayStation 4 v Xbox One: Experts on next-gen battle', 'The release of the PlayStation 4 in North America - it goes on sale in Europe and Latin America in a fortnight - is seen by many as the true dawn for next-generation console gaming after the troubled launch of Nintendo''s Wii U.\r\nEarly reviews of Sony''s new machine have praised its graphics for looking "cinematic"; commended its latest DualShock controller''s added touchpad and redesigned thumbsticks and triggers; and remarked that the console is much quieter and easier to navigate than the seven-year-old original PS3.\r\n\r\nIn a week''s time Microsoft fires back with the launch of the Xbox One, BBC reports.\r\n\r\nIt will be more expensive, but includes a more advanced body-movement sensor in the Kinect; better voice recognition; and a more ambitious bid to take charge of your living room thanks to its ability to control satellite and cable TV set top boxes.\r\n\r\nThe revelation that two cross-platform launch titles - Battlefield 4 and Call of Duty: Ghosts - both feature higher resolution graphics on the PS4 than Xbox One, has played to Sony''s favour.\r\n\r\nBut at this point the Xbox''s exclusive games, including Forza Motorsport and Titanfall, are creating more positive buzz on tech sites than Sony''s Killzone Shadow Fall and Infamous: Second Son.\r\n\r\nThe releases come at a critical time for both firms.\r\n\r\nSony recently slashed its full year profit forecast by 40%, surprising investors. Chief executive Kaz Hirai would like the PS4 to mirror the healthy sales of its smartphones, rather than its struggling TV unit.\r\n\r\nMeanwhile, Microsoft has still to declare who will replace Steve Ballmer. The next chief executive has already been urged to "get rid" of the Xbox unit by the fund manager looking after Microsoft co-founder Paul Allen''s $2bn (£1.2bn) stake in the business.\r\n\r\n&nbsp;', '', '', 'en', 1, 0, 'http://nyut.am/disk/15-11-13/45d9b5155c40bf9e075ab282648a2a7e.jpg', '', '', 0, 0, 0, 0, '2013-11-15 14:00:21', '2013-11-15 14:00:21', 3);
